const task = require('../Models/task');
const { ObjectId } = require('mongoose').Types;

var getTask = (req, res) => {
    // Viết logic
    task.find({})
        .then((Tasks) => {
            res.json(Tasks);
        })
        .catch((error) => {
            console.error(error);
            res.status(500).json({ error: 'Internal server error' });
        });
}

var addTask = (req, res) => {
    const name = req.body.name;
    const task_date = req.body.task_date

    const newTask = new task({
        taskName: name,
        completed: false,
        task_date: task_date
    });

    newTask.save()
    res.send("Add succcesfully");
}

var deleteTask = async (req, res) => {
    const taskId = req.body.id;
    const objectId = new ObjectId(taskId);
    try {
        const result = await task.deleteOne({ _id: objectId });
        res.send('delete successfully');
    } catch (error) {
        console.log(error);
        res.status(500).send('delete failed');
    }
};

var updateTask = async (req, res) => {
    const _id = req.body._id
    try {
        const taskData = {
            taskName: req.body.name,
            completed: req.body.completed,
            task_date: req.body.task_date
        };
        const objectId = new ObjectId(_id);

        await task.updateOne(
            { _id: objectId },
            { $set: taskData }
        );
        res.send("Update successfully");
    } catch (error) {
        console.log(error);
        res.status(500).send("Update failed");
    }
}

module.exports = {
    getTask, addTask, deleteTask, updateTask
}
